// Note: since nyc uses this module to output coverage, any lines
// that are in the direct sync flow of nyc's outputCoverage are
// ignored, since we can never get coverage for them.
// grab a reference to node's real process object right away
import { signals } from './signals.js'
export { signals }

// just a loosened process type so we can do some evil things
type ProcessRE = NodeJS.Process & {
  reallyExit: (code?: number | undefined | null) => any
  emit: (ev: string, ...a: any[]) => any
}

const processOk = (process: any): process is ProcessRE =>
  !!process &&
  typeof process === 'object' &&
  typeof process.removeListener === 'function' &&
  typeof process.emit === 'function' &&
  typeof process.reallyExit === 'function' &&
  typeof process.listeners === 'function' &&
  typeof process.kill === 'function' &&
  typeof process.pid === 'number' &&
  typeof process.on === 'function'

const kExitEmitter = Symbol.for('signal-exit emitter')
const global: typeof globalThis & { [kExitEmitter]?: Emitter } = globalThis
const ObjectDefineProperty = Object.defineProperty.bind(Object)

/**
 * A function that takes an exit code and signal as arguments
 *
 * In the case of signal exits *only*, a return value of true
 * will indicate that the signal is being handled, and we should
 * not synthetically exit with the signal we received. Regardless
 * of the handler return value, the handler is unloaded when an
 * otherwise fatal signal is received, so you get exactly 1 shot
 * at it, unless you add another onExit handler at that point.
 *
 * In the case of numeric code exits, we may already have committed
 * to exiting the process, for example via a fatal exception or
 * unhandled promise rejection, so it is impossible to stop safely.
 */
export type Handler = (
  code: number | null | undefined,
  signal: NodeJS.Signals | null
) => true | void
type ExitEvent = 'afterExit' | 'exit'
type Emitted = { [k in ExitEvent]: boolean }
type Listeners = { [k in ExitEvent]: Handler[] }

// teeny special purpose ee
class Emitter {
  emitted: Emitted = {
    afterExit: false,
    exit: false,
  }

  listeners: Listeners = {
    afterExit: [],
    exit: [],
  }

  count: number = 0
  id: number = Math.random()

  constructor() {
    if (global[kExitEmitter]) {
      return global[kExitEmitter]
    }
    ObjectDefineProperty(global, kExitEmitter, {
      value: this,
      writable: false,
      enumerable: false,
      configurable: false,
    })
  }

  on(ev: ExitEvent, fn: Handler) {
    this.listeners[ev].push(fn)
  }

  removeListener(ev: ExitEvent, fn: Handler) {
    const list = this.listeners[ev]
    const i = list.indexOf(fn)
    /* c8 ignore start */
    if (i === -1) {
      return
    }
    /* c8 ignore stop */
    if (i === 0 && list.length === 1) {
      list.length = 0
    } else {
      list.splice(i, 1)
    }
  }

  emit(
    ev: ExitEvent,
    code: number | null | undefined,
    signal: NodeJS.Signals | null
  ): boolean {
    if (this.emitted[ev]) {
      return false
    }
    this.emitted[ev] = true
    let ret: boolean = false
    for (const fn of this.listeners[ev]) {
      ret = fn(code, signal) === true || ret
    }
    if (ev === 'exit') {
      ret = this.emit('afterExit', code, signal) || ret
    }
    return ret
  }
}

abstract class SignalExitBase {
  abstract onExit(cb: Handler, opts?: { alwaysLast?: boolean }): () => void
  abstract load(): void
  abstract unload(): void
}

const signalExitWrap = <T extends SignalExitBase>(handler: T) => {
  return {
    onExit(cb: Handler, opts?: { alwaysLast?: boolean }) {
      return handler.onExit(cb, opts)
    },
    load() {
      return handler.load()
    },
    unload() {
      return handler.unload()
    },
  }
}

class SignalExitFallback extends SignalExitBase {
  onExit() {
    return () => {}
  }
  load() {}
  unload() {}
}

class SignalExit extends SignalExitBase {
  // "SIGHUP" throws an `ENOSYS` error on Windows,
  // so use a supported signal instead
  /* c8 ignore start */
  #hupSig = process.platform === 'win32' ? 'SIGINT' : 'SIGHUP'
  /* c8 ignore stop */
  #emitter = new Emitter()
  #process: ProcessRE
  #originalProcessEmit: ProcessRE['emit']
  #originalProcessReallyExit: ProcessRE['reallyExit']

  #sigListeners: { [k in NodeJS.Signals]?: () => void } = {}
  #loaded: boolean = false

  constructor(process: ProcessRE) {
    super()
    this.#process = process
    // { <signal>: <listener fn>, ... }
    this.#sigListeners = {}
    for (const sig of signals) {
      this.#sigListeners[sig] = () => {
        // If there are no other listeners, an exit is coming!
        // Simplest way: remove us and then re-send the signal.
        // We know that this will kill the process, so we can
        // safely emit now.
        const listeners = this.#process.listeners(sig)
        let { count } = this.#emitter
        // This is a workaround for the fact that signal-exit v3 and signal
        // exit v4 are not aware of each other, and each will attempt to let
        // the other handle it, so neither of them do. To correct this, we
        // detect if we're the only handler *except* for previous versions
        // of signal-exit, and increment by the count of listeners it has
        // created.
        /* c8 ignore start */
        const p = process as unknown as {
          __signal_exit_emitter__?: { count: number }
        }
        if (
          typeof p.__signal_exit_emitter__ === 'object' &&
          typeof p.__signal_exit_emitter__.count === 'number'
        ) {
          count += p.__signal_exit_emitter__.count
        }
        /* c8 ignore stop */
        if (listeners.length === count) {
          this.unload()
          const ret = this.#emitter.emit('exit', null, sig)
          /* c8 ignore start */
          const s = sig === 'SIGHUP' ? this.#hupSig : sig
          if (!ret) process.kill(process.pid, s)
          /* c8 ignore stop */
        }
      }
    }

    this.#originalProcessReallyExit = process.reallyExit
    this.#originalProcessEmit = process.emit
  }

  onExit(cb: Handler, opts?: { alwaysLast?: boolean }) {
    /* c8 ignore start */
    if (!processOk(this.#process)) {
      return () => {}
    }
    /* c8 ignore stop */

    if (this.#loaded === false) {
      this.load()
    }

    const ev = opts?.alwaysLast ? 'afterExit' : 'exit'
    this.#emitter.on(ev, cb)
    return () => {
      this.#emitter.removeListener(ev, cb)
      if (
        this.#emitter.listeners['exit'].length === 0 &&
        this.#emitter.listeners['afterExit'].length === 0
      ) {
        this.unload()
      }
    }
  }

  load() {
    if (this.#loaded) {
      return
    }
    this.#loaded = true

    // This is the number of onSignalExit's that are in play.
    // It's important so that we can count the correct number of
    // listeners on signals, and don't wait for the other one to
    // handle it instead of us.
    this.#emitter.count += 1

    for (const sig of signals) {
      try {
        const fn = this.#sigListeners[sig]
        if (fn) this.#process.on(sig, fn)
      } catch (_) {}
    }

    this.#process.emit = (ev: string, ...a: any[]) => {
      return this.#processEmit(ev, ...a)
    }
    this.#process.reallyExit = (code?: number | null | undefined) => {
      return this.#processReallyExit(code)
    }
  }

  unload() {
    if (!this.#loaded) {
      return
    }
    this.#loaded = false

    signals.forEach(sig => {
      const listener = this.#sigListeners[sig]
      /* c8 ignore start */
      if (!listener) {
        throw new Error('Listener not defined for signal: ' + sig)
      }
      /* c8 ignore stop */
      try {
        this.#process.removeListener(sig, listener)
        /* c8 ignore start */
      } catch (_) {}
      /* c8 ignore stop */
    })
    this.#process.emit = this.#originalProcessEmit
    this.#process.reallyExit = this.#originalProcessReallyExit
    this.#emitter.count -= 1
  }

  #processReallyExit(code?: number | null | undefined) {
    /* c8 ignore start */
    if (!processOk(this.#process)) {
      return 0
    }
    this.#process.exitCode = code || 0
    /* c8 ignore stop */

    this.#emitter.emit('exit', this.#process.exitCode, null)
    return this.#originalProcessReallyExit.call(
      this.#process,
      this.#process.exitCode
    )
  }

  #processEmit(ev: string, ...args: any[]): any {
    const og = this.#originalProcessEmit
    if (ev === 'exit' && processOk(this.#process)) {
      if (typeof args[0] === 'number') {
        this.#process.exitCode = args[0]
        /* c8 ignore start */
      }
      /* c8 ignore start */
      const ret = og.call(this.#process, ev, ...args)
      /* c8 ignore start */
      this.#emitter.emit('exit', this.#process.exitCode, null)
      /* c8 ignore stop */
      return ret
    } else {
      return og.call(this.#process, ev, ...args)
    }
  }
}

const process = globalThis.process
// wrap so that we call the method on the actual handler, without
// exporting it directly.
export const {
  /**
   * Called when the process is exiting, whether via signal, explicit
   * exit, or running out of stuff to do.
   *
   * If the global process object is not suitable for instrumentation,
   * then this will be a no-op.
   *
   * Returns a function that may be used to unload signal-exit.
   */
  onExit,

  /**
   * Load the listeners.  Likely you never need to call this, unless
   * doing a rather deep integration with signal-exit functionality.
   * Mostly exposed for the benefit of testing.
   *
   * @internal
   */
  load,

  /**
   * Unload the listeners.  Likely you never need to call this, unless
   * doing a rather deep integration with signal-exit functionality.
   * Mostly exposed for the benefit of testing.
   *
   * @internal
   */
  unload,
} = signalExitWrap(
  processOk(process) ? new SignalExit(process) : new SignalExitFallback()
)

// biome-ignore-all lint/suspicious/noImplicitAnyLet: legacy format
// biome-ignore-all lint/suspicious/noExplicitAny: legacy format
import crypto from "node:crypto";
import EventEmitter from "node:events";
import type { IncomingMessage } from "node:http";
import stream, { PassThrough as PassThroughStream } from "node:stream";
import urlLib, { URL } from "node:url";
import { getStreamAsBuffer } from "get-stream";
import CachePolicy from "http-cache-semantics";
import { Keyv } from "keyv";
import mimicResponse from "mimic-response";
import normalizeUrl from "normalize-url";
import Response from "responselike";
import {
	type CacheableOptions,
	CacheError,
	type CacheResponse,
	type CacheValue,
	type Emitter,
	RequestError,
	type RequestFn,
	type UrlOption,
} from "./types.js";

type Function_ = (...arguments_: any[]) => any;

class CacheableRequest {
	cache: Keyv = new Keyv<any>({ namespace: "cacheable-request" });
	cacheRequest: RequestFn;
	hooks: Map<string, Function_> = new Map<string, Function_>();
	constructor(cacheRequest: RequestFn, cacheAdapter?: any) {
		if (cacheAdapter) {
			if (cacheAdapter instanceof Keyv) {
				this.cache = cacheAdapter;
			} else {
				this.cache = new Keyv({
					store: cacheAdapter,
					namespace: "cacheable-request",
				});
			}
		}

		this.request = this.request.bind(this);
		this.cacheRequest = cacheRequest;
	}

	request =
		() =>
		(
			options: CacheableOptions,
			callback?: (response: CacheResponse) => void,
		): Emitter => {
			let url;
			if (typeof options === "string") {
				url = normalizeUrlObject(parseWithWhatwg(options));
				options = {};
			} else if (options instanceof urlLib.URL) {
				url = normalizeUrlObject(parseWithWhatwg(options.toString()));
				options = {};
			} else {
				const [pathname, ...searchParts] = (options.path ?? "").split("?");
				const search =
					searchParts.length > 0 ? `?${searchParts.join("?")}` : "";
				url = normalizeUrlObject({ ...options, pathname, search });
			}

			options = {
				headers: {},
				method: "GET",
				cache: true,
				strictTtl: false,
				automaticFailover: false,
				...options,
				...urlObjectToRequestOptions(url),
			};
			options.headers = Object.fromEntries(
				entries(options.headers).map(([key, value]) => [
					(key as string).toLowerCase(),
					value,
				]),
			);
			const ee: Emitter = new EventEmitter() as Emitter;
			const normalizedUrlString = normalizeUrl(urlLib.format(url), {
				stripWWW: false,
				removeTrailingSlash: false,
				stripAuthentication: false,
			});
			let key = `${options.method}:${normalizedUrlString}`;
			// POST, PATCH, and PUT requests may be cached, depending on the response
			// cache-control headers. As a result, the body of the request should be
			// added to the cache key in order to avoid collisions.
			if (
				options.body &&
				options.method !== undefined &&
				["POST", "PATCH", "PUT"].includes(options.method)
			) {
				if (options.body instanceof stream.Readable) {
					// Streamed bodies should completely skip the cache because they may
					// or may not be hashable and in either case the stream would need to
					// close before the cache key could be generated.
					options.cache = false;
				} else {
					key += `:${crypto.createHash("md5").update(options.body).digest("hex")}`;
				}
			}

			let revalidate: any = false;
			let madeRequest = false;
			const makeRequest = (options_: any) => {
				madeRequest = true;
				let requestErrored = false;
				/* c8 ignore next 4 */
				let requestErrorCallback: (...arguments_: any[]) => void = () => {
					/* do nothing */
				};

				const requestErrorPromise = new Promise<void>((resolve) => {
					requestErrorCallback = () => {
						if (!requestErrored) {
							requestErrored = true;
							resolve();
						}
					};
				});
				const handler = async (response: any) => {
					if (revalidate) {
						response.status = response.statusCode;
						const originalPolicy = CachePolicy.fromObject(
							revalidate.cachePolicy,
						);
						const revalidatedPolicy = originalPolicy.revalidatedPolicy(
							options_,
							response,
						);
						if (!revalidatedPolicy.modified) {
							response.resume();
							await new Promise((resolve) => {
								// Skipping 'error' handler cause 'error' event should't be emitted for 304 response
								response.once("end", resolve);
							});
							// Get headers from revalidated policy
							const headers = convertHeaders(
								revalidatedPolicy.policy.responseHeaders(),
							);

							// Preserve headers from the original cached response that may have been
							// lost during revalidation (e.g., content-encoding, content-type, etc.)
							// This works around a limitation in http-cache-semantics where some headers
							// are not preserved when a 304 response has minimal headers
							const originalHeaders = convertHeaders(
								originalPolicy.responseHeaders(),
							);

							// Headers that should be preserved from the cached response
							// according to RFC 7232 section 4.1
							const preserveHeaders = [
								"content-encoding",
								"content-type",
								"content-length",
								"content-language",
								"content-location",
								"etag",
							];

							for (const headerName of preserveHeaders) {
								if (
									originalHeaders[headerName] !== undefined &&
									headers[headerName] === undefined
								) {
									headers[headerName] = originalHeaders[headerName];
								}
							}

							response = new Response({
								statusCode: revalidate.statusCode,
								headers,
								body: revalidate.body,
								url: revalidate.url,
							});
							response.cachePolicy = revalidatedPolicy.policy;
							response.fromCache = true;
						}
					}

					if (!response.fromCache) {
						response.cachePolicy = new CachePolicy(
							options_,
							response,
							options_,
						);
						response.fromCache = false;
					}

					let clonedResponse;
					if (options_.cache && response.cachePolicy.storable()) {
						clonedResponse = cloneResponse(response);
						(async () => {
							try {
								const bodyPromise = getStreamAsBuffer(response);
								await Promise.race([
									requestErrorPromise,
									new Promise((resolve) => response.once("end", resolve)),
									new Promise((resolve) => response.once("close", resolve)),
								]);
								const body = await bodyPromise;
								let value: CacheValue = {
									url: response.url,
									statusCode: response.fromCache
										? revalidate.statusCode
										: response.statusCode,
									body,
									cachePolicy: response.cachePolicy.toObject(),
								};
								let ttl = options_.strictTtl
									? response.cachePolicy.timeToLive()
									: undefined;
								if (options_.maxTtl) {
									ttl = ttl ? Math.min(ttl, options_.maxTtl) : options_.maxTtl;
								}

								if (this.hooks.size > 0) {
									for (const key_ of this.hooks.keys()) {
										value = await this.runHook(key_, value, response);
									}
								}

								await this.cache.set(key, value, ttl);
								/* c8 ignore next -- @preserve */
							} catch (error: any) {
								/* c8 ignore next -- @preserve */
								ee.emit("error", new CacheError(error));
								/* c8 ignore next -- @preserve */
							}
						})();
					} else if (options_.cache && revalidate) {
						(async () => {
							try {
								await this.cache.delete(key);
								/* c8 ignore next -- @preserve */
							} catch (error: any) {
								/* c8 ignore next -- @preserve */
								ee.emit("error", new CacheError(error));
								/* c8 ignore next -- @preserve */
							}
						})();
					}

					ee.emit("response", clonedResponse ?? response);
					if (typeof callback === "function") {
						callback(clonedResponse ?? response);
					}
				};

				try {
					const request_ = this.cacheRequest(options_, handler);
					request_.once("error", requestErrorCallback);
					request_.once("abort", requestErrorCallback);
					request_.once("destroy", requestErrorCallback);
					ee.emit("request", request_);
				} catch (error: any) {
					ee.emit("error", new RequestError(error));
				}
			};

			(async () => {
				const get = async (options_: any) => {
					await Promise.resolve();
					const cacheEntry = options_.cache
						? await this.cache.get(key)
						: undefined;

					if (cacheEntry === undefined && !options_.forceRefresh) {
						makeRequest(options_);
						return;
					}

					const policy = CachePolicy.fromObject(
						(cacheEntry as CacheValue).cachePolicy,
					);
					if (
						policy.satisfiesWithoutRevalidation(options_) &&
						!options_.forceRefresh
					) {
						const headers = convertHeaders(policy.responseHeaders());
						const bodyBuffer = (cacheEntry as CacheValue).body;
						const body = Buffer.from(bodyBuffer as string);
						const response: any = new Response({
							statusCode: (cacheEntry as CacheValue).statusCode,
							headers,
							body,
							url: (cacheEntry as CacheValue).url,
						});
						response.cachePolicy = policy;
						response.fromCache = true;
						ee.emit("response", response);
						if (typeof callback === "function") {
							callback(response);
						}
					} else if (
						policy.satisfiesWithoutRevalidation(options_) &&
						Date.now() >= policy.timeToLive() &&
						options_.forceRefresh
					) {
						await this.cache.delete(key);
						options_.headers = policy.revalidationHeaders(options_);
						makeRequest(options_);
					} else {
						revalidate = cacheEntry;
						options_.headers = policy.revalidationHeaders(options_);
						makeRequest(options_);
					}
				};

				const errorHandler = (error: Error) =>
					ee.emit("error", new CacheError(error));
				if (this.cache instanceof Keyv) {
					const cachek = this.cache;
					cachek.once("error", errorHandler);
					ee.on("error", () => {
						cachek.removeListener("error", errorHandler);
					});
					ee.on("response", () => {
						cachek.removeListener("error", errorHandler);
					});
				}

				try {
					await get(options);
				} catch (error: any) {
					/* v8 ignore next -- @preserve */
					if (options.automaticFailover && !madeRequest) {
						makeRequest(options);
					}

					ee.emit("error", new CacheError(error));
				}
			})();

			return ee;
		};

	addHook = (name: string, function_: Function_) => {
		if (!this.hooks.has(name)) {
			this.hooks.set(name, function_);
		}
	};

	removeHook = (name: string) => this.hooks.delete(name);

	getHook = (name: string) => this.hooks.get(name);

	runHook = async (name: string, ...arguments_: any[]): Promise<CacheValue> =>
		this.hooks.get(name)?.(...arguments_);
}

const entries = Object.entries as <T>(
	object: T,
) => Array<[keyof T, T[keyof T]]>;

const cloneResponse = (response: IncomingMessage) => {
	const clone = new PassThroughStream({ autoDestroy: false });
	mimicResponse(response, clone);

	return response.pipe(clone);
};

const urlObjectToRequestOptions = (url: any) => {
	const options: UrlOption = { ...url };
	options.path = `${url.pathname || "/"}${url.search || ""}`;
	delete options.pathname;
	delete options.search;
	return options;
};

const normalizeUrlObject = (url: any) =>
	// If url was parsed by url.parse or new URL:
	// - hostname will be set
	// - host will be hostname[:port]
	// - port will be set if it was explicit in the parsed string
	// Otherwise, url was from request options:
	// - hostname or host may be set
	// - host shall not have port encoded
	({
		protocol: url.protocol,
		auth: url.auth,
		hostname: url.hostname || url.host || "localhost",
		port: url.port,
		pathname: url.pathname,
		search: url.search,
	});

const convertHeaders = (headers: CachePolicy.Headers) => {
	const result: any = [];
	for (const name of Object.keys(headers)) {
		result[name.toLowerCase()] = headers[name];
	}

	return result;
};

export const parseWithWhatwg = (raw: string) => {
	const u = new URL(raw);

	// If normalizeUrlObject expects the same fields as url.parse()
	return {
		protocol: u.protocol, // E.g. 'https:'
		slashes: true, // Always true for WHATWG URLs
		/* c8 ignore next 3 */
		auth: u.username || u.password ? `${u.username}:${u.password}` : undefined,
		host: u.host, // E.g. 'example.com:8080'
		port: u.port, // E.g. '8080'
		hostname: u.hostname, // E.g. 'example.com'
		hash: u.hash, // E.g. '#quux'
		search: u.search, // E.g. '?bar=baz'
		query: Object.fromEntries(u.searchParams), // { bar: 'baz' }
		pathname: u.pathname, // E.g. '/foo'
		path: u.pathname + u.search, // '/foo?bar=baz'
		href: u.href, // Full serialized URL
	};
};

export default CacheableRequest;
export * from "./types.js";
export const onResponse = "onResponse";

// Type definitions for cacheable-request 6.0
// Project: https://github.com/lukechilds/cacheable-request#readme
// Definitions by: BendingBender <https://github.com/BendingBender>
//                 Paul Melnikow <https://github.com/paulmelnikow>
// Definitions: https://github.com/DefinitelyTyped/DefinitelyTyped
// TypeScript Version: 2.3

/// <reference types="node" />

import type { Buffer } from "node:buffer";
import type { EventEmitter } from "node:events";
import type {
	ClientRequest,
	RequestOptions,
	request,
	ServerResponse,
} from "node:http";
import type { URL } from "node:url";
import type { CachePolicyObject } from "http-cache-semantics";
import type ResponseLike from "responselike";

export type RequestFn = typeof request;
export type RequestFunction = typeof request;
export type CacheResponse = ServerResponse | typeof ResponseLike;

export type CacheableRequestFunction = (
	options: CacheableOptions,
	callback?: (response: CacheResponse) => void,
) => Emitter;

export type CacheableOptions = (Options & RequestOptions) | string | URL;

export interface Options {
	/**
	 * If the cache should be used. Setting this to `false` will completely bypass the cache for the current request.
	 * @default true
	 */
	cache?: boolean | undefined;

	/**
	 * If set to `true` once a cached resource has expired it is deleted and will have to be re-requested.
	 *
	 * If set to `false`, after a cached resource's TTL expires it is kept in the cache and will be revalidated
	 * on the next request with `If-None-Match`/`If-Modified-Since` headers.
